import React from 'react';
import { Link } from 'react-router-dom';
import './canvas.scss';

export default function Navbar() {
  return (
  <>
    <ul>
        <Link to="/portfolio" className='portfolio'>Check out my projects here!<div className="portfolio__highlight"></div></Link>
        <div className="portfolio__underline"></div>
        <div aria-hidden className="portfolio__filled">Check out my projects here!</div>
    </ul>
  </>
  );
};
